<?php


switch ($options[xPDOTransport::PACKAGE_ACTION]) {
    case xPDOTransport::ACTION_INSTALL:
    case xPDOTransport::ACTION_UPGRADE:

        $output = '';

        $output .= '<div style="width: 400px; padding: 0 0 20px;">Please, don`t forget set Extra_path document ID in system settings after create repository structure.</div>';

        $img = "<img src='data:image/jpeg;base64,' />";

        $output .= "<p>{$img}</p>";

        return $output;

        break;
    case xPDOTransport::ACTION_UNINSTALL:
        break;
}
 